import * as React from "react";
import { Button, StatusBar, Text, View, Image } from "react-native";
import styled from "styled-components";
import { FontAwesome5 } from "@expo/vector-icons";

const MainpageToolbar = () => {
  return (
    <View style={{ flex: 1, backgroundColor: "#1e1e1e" }}>
      <Header>
        <ProfilePhoto source={require("./profilePicture.png")} />
        <Welcome>
          <Text style={{ color: "#1e1e1e" }} heavy medium>
            {" "}
            Welcome,
          </Text>

          <Text>DesignIntoCode</Text>
        </Welcome>
        <FontAwesome5 name="cog" size={24} color="#565656" />
      </Header>

      <StatusBar barStyle="light-content" />
    </View>
  );
};
export default MainpageToolbar;
// const StatusBar = styled.StatusBar``;

const ProfilePhoto = styled.Image`
  width: 40;
  height: 40;
  border-radius: 20px;
`;

const Container = styled.Image`
  flex: 1;
  background
`;

const Header = styled.View`
  flex-direction: row;
  align-items: center;
  margin: 16px 16px 32px 16px;
`;

const Welcome = styled.View`
  flex: 1;
  padding: 16px;
`;
